import React,{Component} from 'react';
import './CustomNav.css';
import { Dropdown, DropdownButton } from 'react-bootstrap';

export default class SignUp extends Component{
    render(){
        return(
            <div>
            <main role="main" className="inner cover">
               <div><h1 className="cover-heading">Sign Up</h1></div>
               <form>
               <label class="lead">Status</label>
               <DropdownButton variant="light" alignRight title="Status" id="dropdown">
               <Dropdown.Item eventKey="1">Admin</Dropdown.Item>
               <Dropdown.Item eventKey="2">Teacher</Dropdown.Item>
               <Dropdown.Item eventKey="3">Parent</Dropdown.Item>
               <Dropdown.Item eventKey="4">Student</Dropdown.Item>
               </DropdownButton>
               </form>
               </main>
           </div>
        )
    }
}
